CREATE DATABASE biblioteca CHARACTER SET utf8mb4;
use biblioteca;
CREATE TABLE libros(
  codigo int NOT NULL AUTO_INCREMENT
  ,Autor     VARCHAR(183)
  ,Titulo    VARCHAR(243)
  ,Editorial VARCHAR(45)
  ,Genero    VARCHAR(43)
  ,Image     VARCHAR(151)
  ,Info      VARCHAR(524)
  ,Item      INTEGER  NOT NULL
 ,PRIMARY KEY (codigo)
);
